import 'package:dio/dio.dart';import 'package:payme_clone/data/models/confirm_code/confirm_code_model.dart';import 'package:payme_clone/data/models/confirm_code/response/confirm_code_response.dart';import 'package:payme_clone/data/models/sign_up/response/sign_up_response.dart';import 'package:payme_clone/data/models/sign_up/sign_up_model.dart';import 'package:retrofit/retrofit.dart';import '../../models/get_all_card/response/get_all_cards_response.dart';import '../../models/sing_in/response/sign_in_response.dart';import '../../models/sing_in/sign_in_model.dart';part 'api_service.g.dart';@RestApi()abstract class ApiService {  factory ApiService(Dio dio, {String baseUrl}) = _ApiService;  @POST('http://195.158.16.140/mobile-bank/v1/auth/sign-up')  Future<SignUpResponse> signUpUser(@Body() SignUpModel signUpModel);  @POST('http://195.158.16.140/mobile-bank/v1/auth/sign-up/verify')  Future<ConfirmCodeResponse> signUpVerify(      @Body() ConfirmCodeModel confirmCodeModel);  @POST('http://195.158.16.140/mobile-bank/v1/auth/sign-in/verify')  Future<ConfirmCodeResponse> signInVerify(      @Body() ConfirmCodeModel confirmCodeModel);  @POST('http://195.158.16.140/mobile-bank/v1/auth/sign-in')  Future<SignInResponse> signInUser(@Body() SignInModel signInModel);  @GET('http://195.158.16.140/mobile-bank/card')  Future<List<GetAllCardsResponse>> getAllCards(@Header('Authorization') String token);}